// ComponentA.js
import React from 'react';
import withTimeTracking from '../hok/withTimeTracking';
import '../index.css'; // Подключаем файл со стилями

const ComponentA = ({ timeSpent }) => {
  return (
    <div className="component">
      <div className="content">Time spent on Component A: {timeSpent} seconds</div>
    </div>
  );
};

export default withTimeTracking(ComponentA);
